My 4th grade daughter had this question for some bizarre reason in her science class:

Given three sets:

A = {4, 5, 7, 9, 1}
B = {5, 5, 3, 3, 1}
C = {2, 10, 6, 8, 3}

Can you exchange one number from each set with a number from a different set so that the sum of the numbers in each set is equal?
